import {
  FETCH_TRENDING_MOVIE,
  FETCH_POPULAR_MOVIE,
  FETCH_TOP_RATED_MOVIE,
  FETCH_UPCOMING_MOVIE,
} from "../constants/action";

const movie_reducer = (state, action) => {
  console.log("reducer: ");
  switch (action.type) {
    case FETCH_TRENDING_MOVIE:
      console.log(FETCH_TRENDING_MOVIE);
      break;
    case FETCH_POPULAR_MOVIE:
      console.log(FETCH_POPULAR_MOVIE);
      break;
    case FETCH_TOP_RATED_MOVIE:
      console.log(FETCH_TOP_RATED_MOVIE);
      break;
    case FETCH_UPCOMING_MOVIE:
      console.log(FETCH_UPCOMING_MOVIE);
      break;
    default:
  }

  return state;
};

export default movie_reducer;
